import React from "react";
import { Paper } from "@material-ui/core";
import useStyles from "../styles";
import UserAccessSteps from "../UserAccessSteps";

interface ModalMyTravelLoginProps {
    onCloseClick?(): void;
}

const ModalMyTravelLogin: React.FC<ModalMyTravelLoginProps> = ({ onCloseClick }) => {

    const classes = useStyles({});

    return (
        <Paper
            className={classes.paper}
            style={{
                padding: "20px",
                textAlign: "center",
                borderRadius: "12px",
            }}
        >
            <UserAccessSteps isModal onCloseClick={onCloseClick} />

        </Paper>
    );
};

export default ModalMyTravelLogin;
